import * as React from "react";
import { Box, Typography, Button } from "@mui/material";
import { Link } from "react-router-dom";
import NavigationBar from "./NavigationBar";

export default function NewPage() {
  return (
    <>
      {/* Navigation Bar */}
      <NavigationBar />

      {/* Main Content */}
      <Box
        sx={{
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
          flexDirection: "column",
          height: "calc(100vh - 64px)", // Ensures it adjusts based on navigation bar height
          color: "#fff",
          backgroundColor: "#f5f5f5",
        }}
      >
        <Typography
          variant="h3"
          sx={{
            backgroundColor: "rgba(0, 0, 0, 0.6)",
            padding: 2,
            borderRadius: 2,
            marginBottom: 4, // Adds spacing between text and button
          }}
        >
          Welcome to Your New Page
        </Typography>

        {/* Back to Calendar Button */}
        <Button
          variant="contained"
          color="primary"
          component={Link}
          to="/calendar"
          sx={{
            textTransform: "none",
            padding: "8px 16px",
            fontSize: "16px",
          }}
        >
          Back to Calendar
        </Button>
      </Box>
    </>
  );
}
